-- TOC entry 263 (class 1259 OID 149508)
-- Name: vw_registro_dados; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW vw_registro_dados AS
 SELECT rd.rastro_produto_id,
    e.nome_empresa,
    p.nome_propriedade,
    tp.descricao_talhao,
    pd.descricao_produto,
    c.descricao_cultivar,
    rp.ano_safra,
    f.descricao_fase,
    a.nome_atributo,
        CASE
            WHEN (rd.valor_lista_atributo_id IS NOT NULL) THEN ( SELECT lista_atributo.valor_lista_atributo
               FROM lista_atributo
              WHERE (lista_atributo.id = rd.valor_lista_atributo_id))
            WHEN (rd.valor_data_atributo IS NOT NULL) THEN (to_char(rd.valor_data_atributo, 'DD/MM/YYYY HH24:MI:SS'::text))::character varying
            ELSE rd.valor_atributo
        END AS valor_atributo,
    rd.comentario_atributo
   FROM ((((((((((registro_dados rd
     JOIN rastro_produto rp ON ((rp.id = rd.rastro_produto_id)))
     JOIN rastro_fase rf ON ((rf.id = rd.rastro_fase_id)))
     JOIN fase f ON ((f.id = rf.fase_id)))
     JOIN rastro_atributo ra ON ((ra.id = rd.rastro_atributo_id)))
     JOIN atributo a ON ((a.id = ra.atributo_id)))
     JOIN empresa e ON ((e.id = rp.empresa_id)))
     JOIN propriedade p ON ((p.id = rp.propriedade_id)))
     JOIN talhao_propriedade tp ON ((tp.id = rp.talhao_propriedade_id)))
     JOIN produto pd ON ((pd.id = rp.produto_id)))
     JOIN cultivar c ON ((c.id = rp.cultivar_id)))
  ORDER BY rd.rastro_produto_id, f.descricao_fase, a.nome_atributo,
        CASE
            WHEN (rd.valor_lista_atributo_id IS NOT NULL) THEN ( SELECT lista_atributo.valor_lista_atributo
               FROM lista_atributo
              WHERE (lista_atributo.id = rd.valor_lista_atributo_id))
            WHEN (rd.valor_data_atributo IS NOT NULL) THEN (to_char(rd.valor_data_atributo, 'DD/MM/YYYY HH24:MI:SS'::text))::character varying
            ELSE rd.valor_atributo
        END;


